import axios from "axios";
//import cors from "cors";

const rssService = {
    endpoint: "https://theoldreader.com/reader/api/0"
}

rssService.starredFeeds = () => {
    const config = {
        method: "GET",
        mode: 'no-cors',
        url: rssService.endpoint + "/stream/contents?output=json&s=user/-/state/com.google/starred",
        crossdomain: true,
        headers: { 
            'Authorization': 'GoogleLogin auth=LyTEJPvTJiSPrCxLu46d', 
            'Cookie': '_new_reader_%3D%3D--4f9494a6fc220ea8028028681f511f1b2b769bd6; i_know_you=maurice.g.washington; remember_user_token=BAhbB1sGVToaTW9wZWQ6OkJTT046Ok9iamVjdElkIhHaA1lcYoeBRAOxiVxJIiIkMmEkMDUkcDlNRmcxTjNmNnl6TEI1YmR2NmRQLgY6BkVU--59a962932b208d66a6b3b6d9be5f2484b1f3c52e; signed_at=1633010722'
          }
    }

    return axios(config)
}

export default rssService
